import React from "react";
import "./AddUserForm.css";

export default function AddUserForm(props) {
  return (
    <form>
      <div className="input">
        <label>Username</label>
        <input type="text" />
      </div>
      <div className="input">
        <label>Age (Years)</label>
        <input type="number" min="0" step="1" />
      </div>
      <button className="button" type="submit">
        Add User
      </button>
    </form>
  );
}
